import { Search } from "@mui/icons-material";
import { Button, IconButton, Input, Stack } from "@mui/material";
import React from "react";
import "../styles/Indexcontent.css";

export const Indexcontent = () => {
  return (
    <div>
      <div className="indexcontainer">
        <Stack
          direction={"row"}
          gap={"30px"}
          width={"610px"}
          height={"7%"}
          textAlign={"center"}
        >
          <Button
            variant="contained"
            className=""
            sx={{
              height: "17px",
              width: "80px",
            }}
          ></Button>
          <input type="text" placeholder="Search"></input>

          <Button
            variant="contained"
            className="buttons"
            sx={{
              height: "17px",
              width: "80px",
            }}
          >
            Show Table
          </Button>
        </Stack>

        <div className=""></div>
      </div>
    </div>
  );
};
